// WMA
function WMA(prices, periods) {
    let pLen = prices.length;   // calculate once for speed.

    // Check we have enough values to make calculation:
    if (pLen < periods) { return 0; }

    let count = 1;
    let numerator = 0;
    for (let i = pLen - periods; i < pLen; i++, count++) {
        numerator += prices[i] * count;
    }
    let value = numerator / ((periods * (periods + 1)) / 2)

    return (value)
}

// Centre of Gravity
function calculateCoG(dataArray, length) {
    let sum = dataArray.reduce((a, b) => (a + b))
    // calculate numerator
    let num = 0
    let price = 0
    for (i = 0; i < length; i++) {
        price = dataArray.at(-(i + 1))
        num += price * (i + 1)
    }

    let result = -num / sum

    result = isFinite(result) ? result : 0
    return result
}

// Price Percentage Oscillator, not to be confused with the Percentage Price Oscillator!
function calculatePPO(value, prevVal, length, previousRMAup, previousRMAdn) {
    // function returns an object. Call instance in the form:
